Usage Example :

$obj = new rtForm();

  ----textbox test
  echo $obj->get_textbox(array(
          "id"=>"myid",
          "label" => "mylabel",
          "name"=>"myname",
          "value"=>"myval",
          "class"=> array("myclass")
  ))."\n";


  ----textarea test
  echo $obj->get_textarea(array(
          "id"=>"myid",
          "name"=>"myname",
          "value"=>"myval",
          "class"=> array("myclass")
  ))."\n";


  ----radio test
  echo $obj->get_radio(array(
          "id"=>"myid",
          "name"=>"myname",
          "class"=>array("myclass"),
          "rtForm_options"=>array(
                  "op1"=>1,
                  "op2"=>2,
                  "op3"=>3
          )
  ))."\n";


  ----checkbox test
  echo $obj->get_checkbox(array(
          "id"=>"myid",
          "name"=>"myname",
          "class"=>array("myclass"),
          "rtForm_options"=>array(
                  "op1"=>1,
                  "op2"=>2,
                  "op3"=>3
          )
  ))."\n";

  ----select test
  echo $obj->get_select(array(
          "id"=>"myid",
          "name"=>"myname",
          "class"=>array("myclass"),
          "rtForm_options"=>array(
                  "op1"=>1,
                  "op2"=>2,
                  "op3"=>3
          )
  ))."\n";

Example:

   Normal getID3 usage (example):

      require_once 'getid3/getid3.php';
      $getID3 = new getID3;
      $getID3->encoding = 'UTF-8';
      $info1 = $getID3->analyze('file1.flac');
      $info2 = $getID3->analyze('file2.wv');

   getID3_cached usage:

      require_once 'getid3/getid3.php';
      require_once 'getid3/getid3/extension.cache.dbm.php';
      $getID3 = new getID3_cached('db3', '/tmp/getid3_cache.dbm',
                                         '/tmp/getid3_cache.lock');
      $getID3->encoding = 'UTF-8';
      $info1 = $getID3->analyze('file1.flac');
      $info2 = $getID3->analyze('file2.wv');


Supported Cache Types

  SQL Databases:          (use extension.cache.mysql)

  cache_type          cache_options
  -------------------------------------------------------------------
  mysql               host, database, username, password


  DBM-Style Databases:    (this extension)

  cache_type          cache_options
  -------------------------------------------------------------------
  gdbm                dbm_filename, lock_filename
  ndbm                dbm_filename, lock_filename
  db2                 dbm_filename, lock_filename
  db3                 dbm_filename, lock_filename
  db4                 dbm_filename, lock_filename  (PHP5 required)

  PHP must have write access to both dbm_filename and lock_filename.


Recommended Cache Types

  Infrequent updates, many reads      any DBM
  Frequent updates                    mysql

Example:  (see also demo.cache.mysql.php in /demo/)

   Normal getID3 usage (example):

      require_once 'getid3/getid3.php';
      $getID3 = new getID3;
      $getID3->encoding = 'UTF-8';
      $info1 = $getID3->analyze('file1.flac');
      $info2 = $getID3->analyze('file2.wv');

   getID3_cached usage:

      require_once 'getid3/getid3.php';
      require_once 'getid3/getid3/extension.cache.mysql.php';
      // 5th parameter (tablename) is optional, default is 'getid3_cache'
      $getID3 = new getID3_cached_mysql('localhost', 'database', 'username', 'password', 'tablename');
      $getID3->encoding = 'UTF-8';
      $info1 = $getID3->analyze('file1.flac');
      $info2 = $getID3->analyze('file2.wv');


Supported Cache Types    (this extension)

  SQL Databases:

  cache_type          cache_options
  -------------------------------------------------------------------
  mysql               host, database, username, password


  DBM-Style Databases:    (use extension.cache.dbm)

  cache_type          cache_options
  -------------------------------------------------------------------
  gdbm                dbm_filename, lock_filename
  ndbm                dbm_filename, lock_filename
  db2                 dbm_filename, lock_filename
  db3                 dbm_filename, lock_filename
  db4                 dbm_filename, lock_filename  (PHP5 required)

  PHP must have write access to both dbm_filename and lock_filename.


Recommended Cache Types

  Infrequent updates, many reads      any DBM
  Frequent updates                    mysql
